const ajiData = [
  {
    id: "image",
    data: "data:image/jpeg;base64,",
  },
];

async function setup() {
  await ajiAddSprite("image", "image");
  const image = ajiGetSprite("image");
  const w = image.width;
  const h = image.height;
  let ratio = 1.0;
  if (w < h) {
    ratio = 240 / h;
  } else {
    ratio = 320 / w;
  }
  ajiDrawSpriteZoom(
    "image",
    160 - (w * ratio) / 2,
    120 - (h * ratio) / 2,
    w * ratio,
    h * ratio
  );
}
